import React from "react";

const BotCard = ({ image, name, phrase,health,damage,armor }) => {
  return (
    // display the details in a card
    <div className="card mb-3" style={{maxWidth:'18rem', marginLeft:'120px'}}>
      <img src={image} alt={name} className="card-img-top"/>
      //
      <div className="card-body" style={{marginLeft:'50px'}}>
      <h2 className="card-name">{name}</h2>
      <p className="card-text">{phrase}</p>
      <hr></hr>
       <i className="fas fa-heartbeat" style={{ fontSize:'12px',marginRight:'5px'}}></i>
       <span style={{fontSize:'15px'}}>{health}</span>
       <i className="fas fa-bolt" style={{ fontSize:'12px',marginLeft:'15px'}}></i>
       <span style={{fontSize:'15px'}}>{damage}</span>
       <i className="fas fa-shield-alt"  style={{ fontSize:'12px',marginLeft:'15px'}}></i>
       <span style={{fontSize:'15px'}}>{armor}</span>
      </div>
    </div>
  );
};

export default BotCard;
